import React from 'react'
import { Navbar } from 'react-bootstrap'
impo
function Browse() {
    const randomJobs = [1,2,3,4];
  return (
    <div>
        <Navbar />
        <div>
            <div>
                <h6>Search Results ({randomJobs.length})</h6>
                {
                    randomJobs.map((item, index)=>{
                        return (
                            <Job />
                        )
                    })
                }
            </div>
        </div>
    </div>
  )
}

export default Browse
